import Header from "./header.jsx";
import "./header.css"


const Menu = () => {
    return (
        <div className="menu-container">
        <Header />
        <div className="content">
        <Menu />
        </div>
        <div className="footer">
            123
            &copy; 2023 Your Company
        </div>
    </div>
    );
}

export default Menu;
